import { createApp } from 'vue'
import App from './App.vue'
import * as VueRouter from 'vue-router'

createApp(App)
.use(VueRouter.createRouter({
    history: VueRouter.createMemoryHistory(process.env.BASE_URL),
    routes: [{
        path: '/',
        component: App
    },{
        path: '/principal',
        component
    }]
}
))
.mount('#app')
